INSERT INTO `wz_oxdata` VALUES ('3', '100', 'The price of Jr. Neck Skin and Stirge Wing is the same.', 'They both go for 12 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '101', 'The price of 2 Jr. Necki skins is LOWER than 1 Ligator skin.', '2 Jr. Neck Skins = 24 mesos. 1 Ligator Skin = 25 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '102', 'Sell 10 Tablecloths from Jr. Wraith, and you\'ll be able to buy a Lemon with it.', 'Lemon costs 305 mesos, so you\'ll be short of 5 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '103', '1 Lorang Claw has the same price as 1 Cold Eye Tail.', 'Lorang Claw = 32 mesos. Cold Eye Tail = 35 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '104', '1 Clang Claw has the same price as the price of 5 Blue Mushroom Caps.', 'Clang Claw = 60 mesos. Blue Mushroom Cap = 12.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '105', 'The price of Umti Shell and Slime Bubble is the same.', 'They both go for 50 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '106', 'If you sell 100 pieces of Iron Hog\'s Metal Hoof, you\'ll be able to buy a Dark Moon Conehat.', '100 pieces of Iron Hog\'s Metal Hoof = 3,800 mesos. Yes, you can buy Dark Moon Conehat with that.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '107', 'The Medicine with Weird Vibes from Wraith will go for the same price as 1 Processed Wood.', 'Medicine with Weird Vibes = 50 mesos. Processed Wood = 20 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '108', 'The price of 128 pieces of Croko Skin is 6,500 mesos.', '128 x 50 = 6,400, not 6,500.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '109', 'If you sell 10 Pig Ribbons to the store, you can buy a Red Potion with those mesos.', '10 Pig Ribbons = 50 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '110', 'A Mushmom Spore has the same price as a Tauromacis Horn.', 'They both go for 100 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '111', 'If you sell the Star Rock at the store, you\'ll get 10,000 mesos per.', 'You\'ll get 10,000 mesos per Star Rock.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '112', 'If you sell 2 Red Snail Shells, 2 Pig Heads, and 1 Slime Bubble at the store, you\'ll get 140 mesos.', 'You\'ll get 30+60+50=140 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '113', 'Both the Yellow Umbrella and the Sky-Blue Umbrella will get you 1 meso if you sell them at the stores.', '1 meso for Sky-Blue Umbrella, but 50,000 mesos for Yellow Umbrella. ', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '114', 'It costs the same whereever in MapleStory to refine the ores.', 'It\'s a little bit cheaper at Kerning City.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '115', 'If you sell your screws at the store, it\'ll fetch you 100 mesos per screw.', 'It goes fo 50 mesos.', 'x');
